//create a protected route 

import React from 'react';
import { Navigate, Route } from 'react-router-dom';

export default function PrivateRoute({ ...props }) {
    const token = localStorage.getItem("token");
    if (!token) {
        return <Navigate to="/login" />
    }
    return <Route {...props} />
}
